    "sex-and-age-distribution-of-the-1987-88-marten-harvest-nowitna-national-wildlife-refuge",nt"isopen":
    false,nt"url": null,nt"notes": "Harvest statistics were obtained from 164
    marten skulls from the 1987 - 88 trapping season supplied by trappers on the Nowitna
    NWR. The sex ration (M:F) is the trap sample was 1.5:1. The sample's juvenile:adult
    female ration was 3.1:1. Juveniles comprised 49% of the sample. Yearling marten
    were under-represented in the sample. An analysis of the temporal distribution of
    harvest of a trapline operated for the entire trapping season indicated that most
    marten were harvested in November and January, the percentage of juveniles in the
    harvest declined as the season progressed, and the percentage of adult females in
    the harvest increased as the season progressed.",nt"license_title": "License
